import React, { useState } from 'react';

function Contact() {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    message: ''
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Here you would typically send the form data to your backend
    console.log('Form submitted:', formData);
    // Reset form after submission
    setFormData({ name: '', email: '', message: '' });
  };

  return (
    <div className="container mx-auto p-4">
      <h1 className="text-4xl font-bold text-purple-600 mb-4">Contact Me</h1>
      <form onSubmit={handleSubmit} className="max-w-md">
        <div className="mb-4">
          <label htmlFor="name" className="block text-black mb-2">Name</label>
          <input
            type="text"
            id="name"
            name="name"
            value={formData.name}
            onChange={handleChange}
            required
            className="w-full px-3 py-2 border border-purple-300 rounded"
          />
        </div>
        <div className="mb-4">
          <label htmlFor="email" className="block text-black mb-2">Email</label>
          <input
            type="email"
            id="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
            required
            className="w-full px-3 py-2 border border-purple-300 rounded"
          />
        </div>
        <div className="mb-4">
          <label htmlFor="message" className="block text-black mb-2">Message</label>
          <textarea
            id="message"
            name="message"
            value={formData.message}
            onChange={handleChange}
            required
            className="w-full px-3 py-2 border border-purple-300 rounded"
            rows="4"
          ></textarea>
        </div>
        <button type="submit" className="bg-purple-600 text-white px-4 py-2 rounded hover:bg-purple-700">
          Send Message
        </button>
      </form>
      <div className="mt-8">
        <h2 className="text-2xl font-bold text-purple-600 mb-2">Connect with me</h2>
        <div className="flex space-x-4">
          <a href="https://linkedin.com" className="text-purple-600 hover:underline">LinkedIn</a>
          <a href="https://github.com" className="text-purple-600 hover:underline">GitHub</a>
          <a href="https://twitter.com" className="text-purple-600 hover:underline">Twitter</a>
        </div>
      </div>
    </div>
  );
}

export default Contact;
